class SongModel {
    ID: number;
    Name: string;
    Artist?: string;
    URL?: string;

    constructor (ID: number, Name: string, Artist: string, URL: string) {
            this.ID = ID;
            this.Name = Name;
            this.Artist = Artist;
            this.URL = URL;
    }
}

export default SongModel;
